nzania<\/a>&nbsp;<a href=\"http:\/\/www.poste.tn\/\" target=\"_blank\" style=\"margin:0px;padding:0px;color:#FF9900;text-decoration:none;font-size:14px;line-height:30px;\">Tunisia<\/a>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tU:&nbsp;<a href=\"https:\/\/www.royalmail.com\/portal\/sme\/trackresult\" target=\"_blank\" style=\"margin:0px;padding:0px;color:#FF9900;text-decoration:none;font-size:14px;line-height:30px;\">Kingdom<\/a>&nbsp;<a href=\"http:\/\/www.correo.com.uy\/index.asp?codPag=tyt\" target=\"_blank\" style=\"margin:0px;padding:0px;color:#FF9900;text-decoration:none;font-size:14px;line-height:30px;\">Uruguay<\/a>&nbsp;<a href=\"http:\/\/www.ukrposhta.com\/www\/upost_en.nsf\/search_post?openpage\" target=\"_blank\" style=\"margin:0px;padding:0px;color:#FF9900;text-decoration:none;font-size:14px;line-height:30px;\">Ukraine<\/a>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tV:&nbsp;<a href=\"http:\/\/www.postvanuatu.com\/\" target=\"_blank\" style=\"margin:0px;padding:0px;color:#FF9900;text-decoration:none;font-size:14px;line-height:30px;\">Vanuatu<\/a>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<span style=\"margin:0px;padding:0px;color:#CC0000;\">Note:<\/span>You can click your country name when the parcel has arrived in your country , and then check the parcel status.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">What should I do if I can't track my parcel?<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tIf you come across this problem, please verify the following:\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t\u25cf &nbsp; Did you enter the right tracking number?\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t\u25cf &nbsp; Did you choose the right tracking website?\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tIf you answered yes, then contact our customer service to check for you.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Everything is right, why can't I find information about my parcel?<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t1.\tMost of the time, it's because the information has not been updated by the shipping company.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tChina Post (EMS, Airmail, SAL)\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\ta)&nbsp; Sometimes tracking information will not be updated in time. They need at least 3 days for tracking to be posted. Please be patient.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tb)&nbsp; If the parcel was sent during public holidays, the information may be available after the holiday.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Why is the status not changing in tracking status page?<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tWhen your package leaves Beijing, it will be put in queue to be delivered to your country. During this transit, the status will not change, so it is common to see your package stuck in the status \"Dispatch ...\" This transit is the longest process, and usually takes 7-10 days (or up to 30 days during busy seasons)\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">When is the busy season?<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tBusy season is November to February every year. This is because of Christmas and Chinese New Year.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">What should I do if I did not get the parcel after a long time?<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tIf you still do not get your parcel 30 days after the shipping date, please contact us for help tracking your parcel. Xu will request China Post Office to provide us with the tracking list of the parcel. Please email us the following information:\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t* Tracking number.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t* The complete information as listed below:\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tName:\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tAddress:\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tCity:\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tCountry:\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tPost Code:\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tTelephone:\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tThe above information should be identical to the one on the waybill.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tIt might take a long time to get the detailed tracking list. Generally speaking, initial checking will take one week. Sometimes the tracking might fail, and the China Post Office will have to send the request again.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tIf there is no confirmation from China Post Office before deadline, we will treat the parcel as lost and you will get compensation according to our Insurance Policy.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tConfirmation deadline after shipping date*\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t(Please note that the shipping date and final delivery date are subject to the exact date on the tracking website.)\r\n<\/p>\r\n<table class=\"MsoTableGrid\" border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"margin:0px;padding:0px;width:759px;color:#333333;font-family:Arial, Helvetica, sans-serif;font-size:12px;line-height:18px;background-color:#FFFFFF;border:medium none;\">\r\n\t<tbody style=\"margin:0px;padding:0px;\">\r\n\t\t<tr style=\"margin:0px;padding:0px;\">\r\n\t\t\t<td valign=\"top\" width=\"121\" style=\"margin:0px;padding:0cm 5.4pt;width:90.45pt;border:1pt solid black;\">\r\n\t\t\t\t<p class=\"MsoNormal\" style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<span style=\"margin:0px;padding:0px;\">Shipping Methods<\/span>\r\n\t\t\t\t<\/p>\r\n