">\u0431\u0435\u0434\u0440\u0430<\/span><\/span><\/strong><br style=\"margin:0px;padding:0px;\" \/>\r\n<span style=\"white-space:nowrap;\">\u0432\u0441\u0442\u0430\u0442\u044c \u043d\u0430 \u043d\u043e\u0433\u0438, \u043a\u0430\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u043e, \u043b\u0435\u043d\u0442\u044b \u0432 \u043d\u0435\u0434\u0435\u043b\u044e \u0432\u044b \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e \u0447\u0430\u0441\u0442\u044c \u0431\u0435\u0434\u0440\u0430<\/span>.\r\n\t\t\t\t<\/p>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<br style=\"margin:0px;padding:0px;\" \/>\r\n<strong style=\"margin:0px;padding:0px;\">E: <span style=\"white-space:nowrap;\">\u0440\u0443\u043a\u0443 \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044f<\/span><\/strong><br style=\"margin:0px;padding:0px;\" \/>\r\n<span style=\"color:#333333;font-family:arial;font-size:10px;line-height:22px;white-space:normal;background-color:#FFFFFF;\">\u0437\u0430\u0431\u0440\u0430\u0442\u044c \u0442\u0432\u043e\u044e \u0440\u0443\u043a\u0443, \u0441 \u043e\u0434\u043d\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b, \u043e\u0434\u0438\u043d \u043a\u043e\u043d\u0435\u0446 \u043a\u043b\u0435\u0439\u043a\u043e\u0439 \u043b\u0435\u043d\u0442\u044b \u0432 \u0448\u0435\u044e \u0438 \u043f\u043b\u0435\u0447\u0438 \u043f\u043e\u0434 \u0440\u0443\u043a\u0443 \u0437\u0430\u0442\u044b\u043b\u043e\u043a \u0438\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u044f \u0437\u0430\u043f\u044f\u0441\u0442\u044c\u0435<\/span><span style=\"font-size:10px;\"><\/span><span style=\"font-size:10px;\">.<\/span>\r\n\t\t\t\t<\/p>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<br style=\"margin:0px;padding:0px;\" \/>\r\n<span style=\"color:#333333;font-family:arial;font-size:10px;line-height:22px;white-space:normal;background-color:#FFFFFF;\">\u0434\u043b\u044f \u0438\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u044f \u043f\u043e\u0441\u043b\u0435 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e, \u0432\u044b \u0434\u043e\u043b\u0436\u043d\u044b \u043e\u0431\u0440\u0430\u0442\u0438\u0442\u044c \u0432\u043d\u0438\u043c\u0430\u043d\u0438\u0435 \u043d\u0430 \u043e\u0434\u0438\u043d \u043c\u043e\u043c\u0435\u043d\u0442.\u0422\u044b \u0434\u043e\u043b\u0436\u0435\u043d \u0437\u043d\u0430\u0442\u044c, \u0447\u0442\u043e \u0442\u044b \u043d\u043e\u0441\u0438\u0448\u044c \u044d\u0442\u043e \u043a\u0440\u0435\u043f\u043a\u043e \u0438\u043b\u0438 \u0441\u043e\u0441\u043d\u044b, \u0431\u043e\u043b\u044c\u0448\u0435 \u0438\u043b\u0438 \u043c\u0435\u043d\u044c\u0448\u0435, \u0447\u0435\u043c \u043e\u0431\u044b\u0447\u043d\u043e.\u0412\u044b, \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e, \u043f\u043e\u0442\u0440\u0435\u0431\u0443\u0435\u0442\u0441\u044f \u043f\u043b\u0430\u0432\u0430\u044e\u0449\u0435\u0433\u043e \u0432\u0432\u0435\u0440\u0445 \u0438 \u0432\u043d\u0438\u0437 \u043f\u043e \u0441\u0445\u0435\u043c\u0435 \u0440\u0430\u0437\u043c\u0435\u0440, \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u043e\u0432 \u0438\u043b\u0438 \u043f\u0440\u0435\u0434\u043c\u0435\u0442\u043e\u0432 \u0432 \u043e\u043f\u0438\u0441\u0430\u043d\u0438\u0435 \u043e\u0442\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u0435 \u043e\u043d\u043b\u0430\u0439\u043d.\u0442\u0430\u043a\u0436\u0435 \u0434\u043e\u043b\u0436\u043d\u044b \u0438\u043c\u0435\u0442\u044c \u0434\u0440\u0443\u0433\u0438\u0445 \u043f\u043e\u043a\u0443\u043f\u0430\u0442\u0435\u043b\u0435\u0439 \u043d\u0430 \u0437\u0430\u043c\u0435\u0447\u0430\u043d\u0438\u044f \u0438 \u0440\u0435\u043a\u043e\u043c\u0435\u043d\u0434\u0430\u0446\u0438\u0438.(\u043f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043e\u0431\u0440\u0430\u0442\u0438\u0442\u0435 \u0432\u043d\u0438\u043c\u0430\u043d\u0438\u0435, \u0447\u0442\u043e \u0440\u0430\u0437\u043c\u0435\u0440 \u041a\u0438\u0442\u0430\u044f, \u0447