tyle=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">If the parcel is returned to us because of delivery error, we will resend it with no additional costs. However, if it is returned to us because of refusal to comply with your country's Customs or rejection of parcel, you will be responsible for all additional costs.<\/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">&nbsp;<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<b style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">Limits of Insurance<\/span><\/b><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Arial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\/span><\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">Returned parcels for reasons involving your local customs will not be compensated. We have no jurisdiction over your country's customs.<\/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Arial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\/span><\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">Returned parcels because you failed to pick up your parcels will not be compensated. You will be responsible for additional fees to have your packet redelivered.<\/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Arial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\/span><\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">Insurance does not cover the durability of your items.<\/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Arial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\/span><\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">If items do not work as expected, insurance will cover your service fee.<\/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">&nbsp;<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<b style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">Exceptions<\/span><\/b><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Arial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\/span><\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">Postal delays<\/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Arial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\/span><\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">Taxes or tariffs imposed by Customs<\/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Arial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\/span><\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">Detainment or confiscati