/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">&nbsp;<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">&nbsp;<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<b style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">If my parcel is lost during the delivery, can I get compensation?<\/span><\/b><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Arial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\/span><\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">For an insured parcel, Lrise&nbsp;will provide full compensation if the parcel lost during delivery.<\/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Aria