serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Lrise&nbsp;total fe<\/strong><strong style=\"margin:0px;padding:0px;\">e<\/strong>= first payment + second payment<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">- First payment:&nbsp;<\/strong>Items fee + domestic shipping fee<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">- Second payment:<\/strong>&nbsp;International delivery fee + Service fee + Storage fee + Customs fee + Insurance fee\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<span style=\"line-height:1.5;\">Lrise&nbsp;accept many&nbsp;payment methods : credit card, Webmoney, Western Union etc...<\/span>\r\n<\/p>\r\n<strong style=\"margin:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">Service fee:<\/strong><span style=\"color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\"><\/span>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tLrise service fee = (Items fee + domestic shipping fee)*6%<br style=\"margin:0px;padding:0px;\" \/>\r\nIf you are wholesaler, you can contact us. We will give you discount for service fee. However, our minimum service charge is 5.6USD per parcel.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Items fee:<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tThe item price is shown on the shopping site you browsing.<strong style=\"margin:0px;padding:0px;\"><\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Domestic shipping fee:<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tMost domestic delivery companies charge 10 to 30CNY per kilogram. The fee differs according to the courier, parcel weight and the distance between seller and buyer's locations<strong style=\"margin:0px;padding:0px;\"><\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">International delivery fee:<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tLrise&nbsp;provide various delivery methods, such as: EMS, DHL,&nbsp;Airmail for small packages, Air Parcel, SAL Parcel, Domestic forwarding.<strong style=\"margin:0px;padding:0px;\"><\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Customs fee:<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tWe suggest that before shipping, lrise&nbsp;customers take the initiative to find out policies of their local customs. In countries with high rate of customs clearance, there is no need to pay any fees. However, in countries with low rate of customs clearance such as Argentina, customers may be required to pay tariffs.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<span style=\"margin:0px;padding:0px;color:#CC0000;\">Note:<\/span>&nbsp;Chinese customs fee is 8 CNY per parcel.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Insurance fee (optional):<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tInsurance fee purchased at 3% of the total price (Items fee + domestic shipping fee + International delivery fee + Service fee + Customs fee).\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Can I get any discount on service fee?<\/strong><br style=\"margin:0px;padding:0px;\" \/>\r\nNormally, can't. Our service fee is 6% of (items price + domestic shipping fee).<br style=\"margin:0px;padding:0px;\" \/>\r\n<br style=\"margin:0px;padding:0px;\" \/>\r\n<strong style=\"margin:0px;padding:0px;\">When should I pay the service fee?<\/strong><br style=\"margin:0px;padding:0px;\" \/>\r\nYou will be asked to pay service charge together with the international shipping of your parcel. After you get the weight of your parcel and have selected the international shipping method, lrise.com will automatically calculate the service fee for you. At that point, you will need to pay the shipping costs and service fee, then lrise will ship your parcel.\r\n<\/p>","info_69":"","info_69_C":"<div style=\"white-space:normal;margin:0px auto;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#F2F2F2;width:980px;clear:both;\">\r\n\t<div class=\"righthelp\" style=\"margin:10px 0px 10px 5px;padding:10px;background-image:none;background-attachment:scroll;background-color:#FFFFFF;float:left;height:auto;overflow:hidden;width:760px;background-position:0px 0px;background-repeat:repeat repeat;\">\r\n\t\t<ul style=\"margin:0px;padding:0px;\">\r\n\t\t\t<li style=\"margin:0px 0px 10px;padding:0px;list-style:none outside none;float:left;height:auto;width:760px;\">\r\n\t\t\t\t<h1 style=\"margin:0px;padding:0px 0px 15px;font-size:14px;float:left;line-height:30px;width:760px;border-bottom-width:1px;border-bottom-style:dotted;border-bottom-color:#CCCCCC;color:#FF9900;\">\r\n\t\t\t\t\t<span style=\"white-space:nowrap;\">\u041a\u0430\u043a \u043f\u043e\u043b\u0443\u0447\u0438\u0442\u044c \u043f\u0440\u0430\u0432\u043e \u043f\u043e\u043a\u0443\u043f\u043a\u0438 \u0432 \u0438\u043d\u0442\u0435\u0440\u043d\u0435\u0442\u0435, \u043a\u043e\u0433\u0434\u0430 \u0440\u0430\u0437\u043c\u0435\u0440\u044b \u043e\u0434\u0435\u0436\u0434\u044b<\/span>\r\n\t\t\t\t<\/h1>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<span style=\"font-family:arial;font-size:10px;line-height:22px;\">\u0422\u044b \u0440\u0430\u0441\u0441\u0442\u0440\u043e\u0435\u043d \u0438 \u0437\u043e\u043b, \u0435\u0441\u043b\u0438 \u0432\u044b \u043f\u043e\u043a\u0443\u043f\u0430\u0435\u0442\u0435 \u043e\u0434\u0435\u0436\u0434\u0443 \u043e\u043d\u043b\u0430\u0439\u043d \u0440\u0430\u0437\u043c\u0435\u0440?\u041f\u043e\u0441\u043a\u043e\u043b\u044c\u043a\u0443 \u0442\u0435\u043b\u043e \u0438\u043c\u0435\u0435\u0442 \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0435 \u0444\u043e\u0440\u043c\u044b \u0432 \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0445 \u043c\u0430\u0440\u043e\u043a \u043e\u0434\u0435\u0436\u0434\u044b; \u0442\u0430\u043a\u0436\u0435 \u0435\u0441\u0442\u044c \u0440\u0430\u0437\u043b\u0438\u0447\u043d\u044b\u0435 \u0430\u0441\u043f\u0435\u043a\u0442\u044b \u0441\u0442\u0430\u043d\u0434\u0430\u0440\u0442\u043e\u0432.\u041f\u043e\u044d\u0442\u043e\u043c\u0443 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043b\u044e\u0434\u0438 \u0438\u043d\u043e\u0433\u0434\u0430 \u043e\u043f\u0430\u0441\u0430\u044e\u0442\u0441\u044f, \u0440\u0430\u0437\u043c\u0435\u0440 \u043e\u0434\u0435\u0436\u0434\u044b \u0432\u044b\u0431\u043e\u0440 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e \u0438\u043b\u0438 \u043d\u0435 \u0437\u043d\u0430\u044e, \u043a\u0430\u043a \u043d\u0430\u0439\u0442\u0438 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u044b\u0439 \u0440\u0430\u0437\u043c\u0435\u0440 \u043e\u0434\u0435\u0436\u0434\u044b.\u0442\u0430\u043a \u043a\u0430\u043a \u043d\u0430\u043c \u0438\u0437\u0431\u0435\u0436\u0430\u0442\u044c \u0432\u044b\u0431\u0440\u0430\u043b \u043d\u0435\u0432\u0435\u0440\u043d\u044b\u0439 \u0440\u0430\u0437\u043c\u0435\u0440 \u043d\u0435 \u043f\u043e\u0434\u0445\u043e\u0434\u0438\u0442 \u043d\u0430\u0448 \u0438\u0434\u0435\u0430\u043b\u044c\u043d\u044b\u0439?\u0432\u043e\u0442 \u043d\u0430\u0439\u0442\u0438 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u044b\u0439 \u0440\u0430\u0437\u043c\u0435\u0440 \u043e\u0434\u0435\u0436\u0434\u044b, \u0447\u0442\u043e\u0431\u044b \u0432\u044b \u0432 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0435 \u043f\u043e\u043a\u0443\u043f\u043e\u043a \u0432 \u0418\u043d\u0442\u0435\u0440\u043d\u0435\u0442\u0435 \u043e\u0447\u0435\u043d\u044c \u0438\u043d\u0442\u0435\u0440\u0435\u0441\u043d\u044b\u0439 \u043d\u0435\u043a\u043e\u0442\u043e\u0440\u044b\u0435 \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u0438\u044f<\/span>.\r\n\t\t\t\t<\/p>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<br style=\"margin:0px;padding:0px;\" \/>\r\n<strong style=\"margin:0px;padding:0px;\"><span style=\"white-space:nowrap;\">\u043e\u0446\u0435\u043d\u0438\u0432\u0430\u0442\u044c \u0441\u0435\u0431\u044f \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u043f\u0435\u0440\u0432\u044b\u0439 \u0433\u0438\u0431\u043a\u0438\u0439 \u0440\u0443\u043b\u0435\u0442\u043a\u0430<\/span><\/strong>\r\n\t\t\t\t<\/p>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<br style=\"margin:0px;padding:0px;\" \/>\r\n<span style=\"font-family:arial;font-size:10px;line-height:22px;\">\u042d\u0442\u043e \u043e\u0447\u0435\u043d\u044c \u043f\u043e\u043b\u0435\u0437\u043d\u043e \u0432 \u0440\u0443\u043a\u0438 \u0435\u0441\u0442\u044c \u043f\u043b\u0430\u0441\u0442\u0438\u043a\u043e\u0432\u044b\u0435 \u0440\u0443\u043b\u0435\u0442\u043a\u0430 \u043e\u043d\u043b\u0430\u0439\u043d - \u043c\u0430\u0433\u0430\u0437\u0438\u043d.\u0422\u044b \u0434\u043e\u043b\u0436\u0435\u043d \u0437\u043d\u0430\u0442\u044c, \u0447\u0442\u043e \u0442\u044b \u0447\u0438\u0441\u0442\u044b\u0439 \u0440\u0430\u0437\u043c\u0435\u0440 \u0431\u044e\u0441\u0442\u0430 \/ \u0433\u0440\u0443\u0434\u0438, \u0442\u0430\u043b\u0438\u0438 \u0438 \u0431\u0435\u0434\u0435\u0440, \u0438 \u0442.\u0434.\u043f\u043e\u044d\u0442\u043e\u043c\u0443 \u043e\u0446\u0435\u043d\u0438\u0432\u0430\u0442\u044c \u0441\u0435\u0431\u044f \u043f\u0435\u0440\u0432\u044b\u0439.\u041f\u043e\u0436\u0430\u043b\u0443\u0439\u0441\u0442\u0430, \u043d\u0435 \u043b\u0435\u043d\u0442\u044b \u043d\u0430 \u0438\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u044f.\u043d\u0443\u0436\u043d\u043e \u043e\u0442\u043c\u0435\u0442\u0438\u0442\u044c, \u0447\u0442\u043e \u043b\u0435\u043d\u0442\u044b \u043e\u0441\u0442\u0430\u0435\u0442\u0441\u044f \u043f\u0430\u0440\u0430\u043b\u043b\u0435\u043b\u044c\u043d\u043e \u043f\u043e\u043b\u0443<\/span><strong style=\"margin:0px;padding:0px;\"><span style=\"font-size:10px;\">.<\/span><\/strong>\r\n\t\t\t\t<\/p>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/2012\/0503\/1\/S1024_2C55A4A3FED947FFAD350A421A4343CA.jpg\" alt=\"undefined\" height=\"432\" width=\"549\" style=\"border-style:none;margin:0px;padding:0px;\" \/>\r\n\t\t\t\t<\/p>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<strong style=\"margin:0px;padding:0px;\">A:&nbsp;<span style=\"white-space:nowrap;\">\u0448\u0438\u0440\u0438\u043d\u0430 \u043f\u043b\u0435\u0447\u0430<\/span><\/strong><br style=\"margin:0px;padding:0px;\" \/>\r\n<span style=\"font-family:arial;font-size:10px;line-height:22px;\">\u0432\u043e\u0437\u0432\u043e\u0434\u0438\u0442\u044c, \u0440\u0430\u0441\u0441\u043b\u0430\u0431\u0438\u0442\u044c\u0441\u044f, \u0438\u0437 \u043e\u0434\u043d\u043e\u0433\u043e \u043a\u043e\u043d\u0446\u0430 \u041a\u0440\u0435\u0441\u0442\u0430 \u043d\u0430 \u043b\u043e\u043f\u0430\u0442\u043a\u0438 (\u043d\u0430 \u0441\u043f\u0438\u043d\u0435 \u0438\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u044f \u0440\u0443\u043a\u0443 \u043d\u0430 \u043f\u043b\u0435\u0447\u043e) \u043a\u043e\u0441\u0442\u0438 (\u043d\u0430 \u0434\u0440\u0443\u0433\u043e\u0439 \u043a\u043e\u043d\u0435\u0446 \u0440\u0443\u043a\u0438)<\/span><span style=\"font-size:10px;\"><\/span>.\r\n\t\t\t\t<\/p>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<br style=\"margin:0px;padding:0px;\" \/>\r\n<strong style=\"margin:0px;padding:0px;\">B:&nbsp;<span style=\"white-space:nowrap;\">\u0431\u044e\u0441\u0442 \/ \u0433\u0440\u0443\u0434\u044c<\/span><\/strong><br style=\"margin:0px;padding:0px;\" \/>\r\n<span style=\"font-family:arial;font-size:10px;line-height:22px;\">\u0441\u0442\u043e\u044f\u0442\u044c \u043f\u0440\u044f\u043c\u043e, \u0440\u0430\u0441\u0441\u043b\u0430\u0431\u0438\u0442\u044c\u0441\u044f, \u0430 \u0437\u0430\u0442\u0435\u043c \u0438\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u044f \u0432\u0430\u0448 \u0431\u044e\u0441\u0442 \/ \u0433\u0440\u0443\u0434\u044c \u0432\u043e\u043a\u0440\u0443\u0433 \u0432\u0430\u0448\u0435\u0433\u043e \u0431\u044e\u0441\u0442 \/ \u0433\u0440\u0443\u0434\u044c \u043b\u0438\u043d\u0438\u0438 \u0438 \u043b\u0435\u043d\u0442\u044b \u0432 \u043e\u0434\u0438\u043d \u043a\u0440\u0443\u0433 \u0440\u0443\u043a\u0443 \u043f\u043e\u0441\u043b\u0435 \u043f\u043e\u043b\u043d\u043e\u0439 \u0447\u0430\u0441\u0442\u044c.(\u0435\u0441\u043b\u0438 \u0432\u044b - \u0436\u0435\u043d\u0449\u0438\u043d\u0430, \u044d\u0442\u043e \u043d\u043e\u0441\u0438\u0442\u044c \u0431\u044e\u0441\u0442\u0433\u0430\u043b\u044c\u0442\u0435\u0440 \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u0442\u043e\u0447\u043d\u043e\u0439. \u0432\u0430\u0436\u043d\u044b\u043c)<\/span><span style=\"font-size:10px;\"><\/span>\r\n\t\t\t\t<\/p>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<br style=\"margin:0px;padding:0px;\" \/>\r\n<strong style=\"margin:0px;padding:0px;\">C:&nbsp;<span style=\"white-space:nowrap;\">\u0442\u0430\u043b\u0438\u0438<\/span><\/strong><br style=\"margin:0px;padding:0px;\" \/>\r\n<span style=\"font-family:arial;font-size:10px;line-height:22px;\">\u0421\u0442\u043e\u044f\u0442\u044c \u0441\u043f\u043e\u043a\u043e\u0439\u043d\u043e \u0434\u044b\u0448\u0430\u0442\u044c, \u0432 \u0432\u0430\u0448\u0435\u0439 \u0442\u0430\u043b\u0438\u0438, \u0435\u0441\u0442\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e, \u044f\u0432\u043b\u044f\u0435\u0442\u0441\u044f \u043d\u0430\u0438\u0431\u043e\u043b\u0435\u0435 \u0443\u0437\u043a\u043e\u0439 \u0447\u0430\u0441\u0442\u0438 \u0432\u0431\u043b\u0438\u0437\u0438 \u0442\u0432\u043e\u0439 \u043f\u0443\u043f\u043e\u043a \u0438\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u044f<\/span><span style=\"font-size:10px;\"><\/span>.\r\n\t\t\t\t<\/p>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\nD:&nbsp;<span style=\"white-space:nowrap;\">\u0431\u0435\u0434\u0440\u0430<\/span><\/strong><br style=\"margin:0px;padding:0px;\" \/>\r\n<span style=\"white-space:nowrap;\">\u0432\u0441\u0442\u0430\u0442\u044c \u043d\u0430 \u043d\u043e\u0433\u0438, \u043a\u0430\u043a \u043f\u0440\u0430\u0432\u0438\u043b\u043e, \u043e\u0442\u0434\u0435\u043b\u044c\u043d\u043e, \u043b\u0435\u043d\u0442\u044b \u0432 \u043d\u0435\u0434\u0435\u043b\u044e \u0432\u044b \u043c\u0430\u043a\u0441\u0438\u043c\u0430\u043b\u044c\u043d\u043e \u0447\u0430\u0441\u0442\u044c \u0431\u0435\u0434\u0440\u0430<\/span>.\r\n\t\t\t\t<\/p>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<br style=\"margin:0px;padding:0px;\" \/>\r\n<strong style=\"margin:0px;padding:0px;\">E:&nbsp;<span style=\"white-space:nowrap;\">\u0440\u0443\u043a\u0443 \u0441\u0435\u043a\u0440\u0435\u0442\u0430\u0440\u044f<\/span><\/strong><br style=\"margin:0px;padding:0px;\" \/>\r\n<span style=\"font-family:arial;font-size:10px;line-height:22px;\">\u0437\u0430\u0431\u0440\u0430\u0442\u044c \u0442\u0432\u043e\u044e \u0440\u0443\u043a\u0443, \u0441 \u043e\u0434\u043d\u043e\u0439 \u0441\u0442\u043e\u0440\u043e\u043d\u044b, \u043e\u0434\u0438\u043d \u043a\u043e\u043d\u0435\u0446 \u043a\u043b\u0435\u0439\u043a\u043e\u0439 \u043b\u0435\u043d\u0442\u044b \u0432 \u0448\u0435\u044e \u0438 \u043f\u043b\u0435\u0447\u0438 \u043f\u043e\u0434 \u0440\u0443\u043a\u0443 \u0437\u0430\u0442\u044b\u043b\u043e\u043a \u0438\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u044f \u0437\u0430\u043f\u044f\u0441\u0442\u044c\u0435<\/span><span style=\"font-size:10px;\"><\/span><span style=\"font-size:10px;\">.<\/span>\r\n\t\t\t\t<\/p>\r\n\t\t\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t\t\t<br style=\"margin:0px;padding:0px;\" \/>\r\n<span style=\"font-family:arial;font-size:10px;line-height:22px;\">\u0434\u043b\u044f \u0438\u0437\u043c\u0435\u0440\u0435\u043d\u0438\u044f \u043f\u043e\u0441\u043b\u0435 \u043f\u0440\u0430\u0432\u0438\u043b\u044c\u043d\u043e, \u0432\u044b \u0434\u043e\u043b\u0436\u043d\u044b \u043e\u0431\u0440\u0430\u0442\u0438\u0442\u044c \u0432\u043d\u0438\u043c\u0430\u043d\u0438\u0435 \u043d\u0430 \u043e\u0434\u0438\u043d \u043c\u043e\u043c\u0435\u043d\u0442.\u0422\u044b \u0434\u043e\u043b\u0436\u0435\u043d \u0437\u043d\u0430\u0442\u044c, \u0447\u0442\u043e \u0442\u044b \u043d\u043e\u0441\u0438\u0448\u044c \u044d\u0442\u043e \u043a\u0440\u0435\u043f\u043a\u043e \u0438\u043b\u0438 \u0441\u043e\u0441\u043d\u044b, \u0431\u043e\u043b\u044c\u0448\u0435 \u0438\u043b\u0438 \u043c\u0435\u043d\u044c\u0448\u0435, \u0447\u0435\u043c \u043e\u0431\u044b\u0447\u043d\u043e.\u0412\u044b, \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e, \u043f\u043e\u0442\u0440\u0435\u0431\u0443\u0435\u0442\u0441\u044f \u043f\u043b\u0430\u0432\u0430\u044e\u0449\u0435\u0433\u043e \u0432\u0432\u0435\u0440\u0445 \u043