lick \"<strong style=\"margin:0px;padding:0px;\">confirm receipt<\/strong>\" when you had received your parcel. And then you can make the evaluation of our services.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;font-size:medium;font-family:Simsun;list-style-type:none;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/www.yoybuy.com\/Content\/Upload\/Text\/ed2b6b9b-3c58-4bbb-905f-6099a0b8a667.jpg\" alt=\"\" height=\"490\" width=\"548\" style=\"border-style:none;margin:0px;padding:0px;vertical-align:middle;list-style-type:none;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\tAfter you have evaluated, it will show this:\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/www.yoybuy.com\/Content\/Upload\/Text\/54cc08cc-d5a5-4228-9699-ba8784b76b82.jpg\" alt=\"\" height=\"200\" width=\"533\" style=\"border-style:none;margin:0px;padding:0px;vertical-align:middle;list-style-type:none;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tClick \u201cok\u201d, and then the order status will change to be \u201cOK\u201d.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tPlease enjoy your shopping at lrise.com:)\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tTags\uff1awhole shopping process , how to buy from lrise\r\n<\/p>","info_61":"","info_61_C":"<h1 style=\"white-space:normal;margin:0px;padding:0px 0px 15px;font-size:14px;float:left;line-height:30px;width:760px;border-bottom-width:1px;border-bottom-style:dotted;border-bottom-color:#CCCCCC;color:#FF9900;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tWhole shopping process on Lrise.com\r\n<\/h1>\r\n<p class=\"MsoNormal\" style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">1) You are able to&nbsp; select items you like from any chinese online stores.After registered on Lrise<\/strong>,<strong style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-size:9pt;\">please go to \u201cnew order\u201din \"my lrise\", or click \u201cQuick Order\u201d on the right side to&nbsp;<strong style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;\">place&nbsp; order in Lrise.com.<\/span><\/strong><\/span><\/strong><span style=\"margin:0px;padding:0px;font-size:9pt;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/www.yoybuy.com\/Content\/Upload\/Text\/6a0af9a2-9628-4efc-b7ed-f6bc61b8c7ba.jpg\" alt=\"\" height=\"122\" width=\"177\" style=\"border-style:none;margin:0px;padding:0px;vertical-align:middle;list-style-type:none;\" \/><img src=\"http:\/\/www.yoybuy.com\/Content\/Upload\/Text\/c38575ae-d4fe-4bfb-bb26-a0377e3a1534.jpg\" alt=\"\" height=\"99\" width=\"229\" style