margin:0px;padding:0px;list-style-type:none;\">Refunded:<\/strong>&nbsp;The money for this item has been refunded back into your account. If you can't find your order, please go to \u201crefund\u201d to check your order.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">Lost:&nbsp;<\/strong><span style=\"margin:0px;padding:0px;font-size:9pt;\">Your items have lost in lrise but please do not worry and&nbsp; we will compensate you; or you can directly contact our customer service department for help.<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">Storing:&nbsp;<\/strong><span style=\"margin:0px;padding:0px;font-size:9pt;\">Your item has been stored in our warehouse.As our free storage time is 90 days,please submit delivery as soon as possible.<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">Abandon:<\/strong>&nbsp;<span style=\"margin:0px;padding:0px;font-size:9pt;\">Lrise storage time is 180 days, and you don't submit delivery during this time. We will think that you have given up your items and we will handle them in our way. (They don't &nbsp;belong to you any more)<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\tYou can click this \u201c<strong style=\"margin:0px;padding:0px;\">chat<\/strong>\u201d to talk to our purchaser if you have any requests for the items.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/www.yoybuy.com\/Content\/Upload\/Text\/e0d50b9a-cac5-460a-8ccb-aa5af4e8b536.jpg\" alt=\"\" height=\"73\" width=\"506\" style=\"border-style:none;margin:0px;padding:0px;vertical-align:middle;list-style-type:none;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;font-size:9pt;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;font-size:9pt;\">If the order is not purchased, you are able to cancel it.<\/span><span style=\"margin:0px;padding:0px;font-size:9pt;\"><\/span><span style=\"margin:0px;padding:0px;font-size:9pt;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/www.yoybuy.com\/Content\/Upload\/Text\/b726d229-77ad-4bc0-9349-9d302f210665.jpg\" alt=\"\" height=\"49\" width=\"506\" style=\"border-style:none;margin:0px;padding:0px;vertical-align:middle;list-style-type:none;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">4) After the items arrive at lrise, please select the items you would like to ship and submit delivery address. After got the exact weight, please select the delivery method and pay delivery fees.<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\tLog in and go to \u201cmy order\u201d, click \u201cArrived\u201d, and then select the items you like to delivery, click \u201csubmit delivery\u201d.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529171857_1147.jpg\" alt=\"\" height=\"130\" width=\"533\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/www.yoybuy.com\/Content\/Upload\/Text\/beae477d-de69-482b-bfa4-0adc0c81b39c.jpg\" alt=\"\" height=\"59\" width=\"533\" style=\"border-style:none;margin:0px;padding:0px;vertical-align:middle;list-style-type:none;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;color:#FF0000;\"><strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\tThen a new page accurs like this:\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529172018_6717.jpg\" alt=\"\" height=\"232\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\tIf you are a new user, please click \u201cNext\u201d,&nbsp;and then fill in the recipient's information, and click \u201cSave\u201d.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529172349_6776.jpg\" alt=\"\" height=\"341\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\tThen you will see this interface about your address.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529172422_3441.jpg\" alt=\"\" height=\"304\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;font-size:9pt;\">Then select the delivery method. We usually recommend China Post\u2014EMS, which is fast (5-7 days) and cheap (you will enjoy 50% discount).<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529172705_7841.jpg\" alt=\"\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;font-size:9pt;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;font-size:9pt;\">Then if you have confirmed all the information, click \u201cpay\u201d.<\/span>\r\n<\/p>\r\n<div style=\"margin:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n<\/div>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529173110_1526.jpg\" alt=\"\" height=\"447\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\"><span style=\"margin:0px;padding:0px;\"><\/span><\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\"><span style=\"margin:0px;padding:0px;color:#E53333;\"><strong style=\"margin:0px;padding:0px;\">Note<\/strong><\/span><span style=\"margin:0px;padding:0px;color:#E53333;\">:&nbsp;<\/span><span style=\"margin:0px;padding:0px;font-size:9pt;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/span><\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;font-size:9pt;\">If you have some special requests about your parcel, please note that in the \u201cremark\u201d.<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;font-size:9pt;\">The \"Declared value\" and Express Waybill description\" are optionally to be filled in.<br style=\"margin:0px;padding:0px;\" \/>\r\n<\/span>\r\n<\/p>\r\n<\/span><\/span><span style=\"white-space:normal;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\"><\/span><span style=\"white-space:normal;\"><\/span>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\tIf your account has no enough money when you click \"pay\", you can click \"add money\" to add enough.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\tAfter paying the delivery fee,<strong style=\"margin:0px;padding:0px;list-style-type:none;\">&nbsp;<\/strong>you will see a picture of your parcel details, and then you can click \u201cBack to my parcels\u201d.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529173547_4958.jpg\" alt=\"\" height=\"255\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529173609_4139.jpg\" alt=\"\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">5) You can go to the menu of \u201cmy parcels\u201d to check the parcel details. Please confirm the receipt of the parcel and then leave a feedback.<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\tLog in and go to \u201cmy parcels\u201d to check the parcel status and details. The status include: Await process, Processing, Shipped, Received, OK.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529173859_5166.jpg\" alt=\"\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529173909_9842.jpg\" alt=\"\" height=\"36\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529173919_1414.jpg\" alt=\"\" style=\"border-style:none;margin:0px;padding:0px;width:600px;height:35px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120529\/20120529174029_7627.jpg\" alt=\"\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120601\/20120601160826_1763.jpg\" alt=\"\" height=\"40\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/image\/20120601\/20120601164710_0752.jpg\" alt=\"\" width=\"600\" style=\"border-style:none;margin:0px;padding:0px 10px 0px 0px;\" \/>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Processing<\/strong>: We are preparing to deal with your parcel, please be patient!\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Shipped<\/strong>: The item has been shipped. Please get ready to receive.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Received<\/strong>: You have received the goods and signed for it.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">OK<\/strong>: You have evaluted our service.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Await process<\/strong>: Your parcel is waiting for processing. Before processing, you can choose to cancel the parcel shipping. After cancelling,&nbsp; the second payment will be refunded to your account automatically. (If you have used the e-coupon, it will not be returned once you cancel the delivery.)\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Await:<\/strong>&nbsp;You should pay the difference because your estimate weight is smaller than real weight.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;font-family:Arial, Helvetica, sans-serif;background-