:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tPlease enjoy your shopping at lrise.com:)\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tTags\uff1awhole shopping process , how to buy from lrise\r\n<\/p>","info_433":"","info_433_C":"<h1 style=\"white-space:normal;margin:0px;padding:0px 0px 15px;font-size:14px;float:left;line-height:30px;width:760px;border-bottom-width:1px;border-bottom-style:dotted;border-bottom-color:#CCCCCC;color:#FF9900;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tHow to use Taobao in English (using Google Chrome)\r\n<\/h1>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tIn order to make your shopping trip more easy and time-saving, Lrise&nbsp;will make an instruction on how to use Taobao in English by using automatic translation function of Google Chrome web browser.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Lrise&nbsp;strongly recommend you to use the Google Chrome web browser (instead of IE or Firefox) when visiting Chinese websites.<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<br style=\"margin:0px;padding:0px;\" \/>\r\nWhen you are viewing Chinese shopping online websites such as Taobao, Dangdang, Paipai and so on, we strongly recommend you to use the Google Chrome web browser. By using the automatic translation function of Google Chrome, you can translate the content into English very easily. Chrome will keep the original