&nbsp;Insurance premium costs 3% of the total price of the order.<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">For example, if the entire order costs 500<\/span><span style=\"margin:0px;padding:0px;font-family:\u5b8b\u4f53;\">&nbsp;<\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">USD, the premium will be 15<\/span><span style=\"margin:0px;padding:0px;font-family:\u5b8b\u4f53;\">&nbsp;<\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">USD.<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">&nbsp;<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<b style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">What is covered?<\/span><\/b><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Arial;\">&nbsp;&nbsp;&nbsp;&nbsp;<\/span><\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">If parcel is lost in transit, Lrise&nbsp;will either give you a full refund, or rebuy &amp; resend your goods. A full refund includes all costs regarding your purchase including item costs, service fees, and all shipping fees. It does not, however, cover the money service fee that is used to transfer money into your&nbsp;account.<\/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Arial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\/span><\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">If items in the parcel are missing, Lrise&nbsp;will refund you the cost of the item, including domestic shipping.<\/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font-family:Arial;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<\/span><\/span><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">If there are major physical damages to the items (such as holes in your clothes, cracked screen, etc.), Lrise&nbsp;will compensate you for items fee and domestic delivery fee.<\/span><span style=\"margin:0px;padding:0px;\"><\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;margin-left:36pt;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;text-indent:-17.95pt;\">\r\n\t<span style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;font-family:Arial;font-size:14px;\">\u25cf<\/span><span style=\"margin:0px;padding:0px;font-size:14px;font