px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Items fee:<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tThe item price is shown on the shopping site you browsing.<strong style=\"margin:0px;padding:0px;\"><\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Domestic shipping fee:<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tMost domestic delivery companies charge 10 to 30CNY per kilogram. The fee differs according to the courier, parcel weight and the distance between seller and buyer's locations<strong style=\"margin:0px;padding:0px;\"><\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">International delivery fee:<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tLrise&nbsp;provide various delivery methods, such as: EMS, DHL,&nbsp;Airmail for small packages, Air Parcel, SAL Parcel, Domestic forwarding.<strong style=\"margin:0px;padding:0px;\"><\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Customs fee:<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tWe suggest that before shipping, lrise&nbsp;customers take the initiative to find out policies of their local customs. In countries with high rate of customs clearance, there is no need to pay any fees. However, in countries with low rate of customs clearance such as Argentina, customers may be required to pay tariffs.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<span style=\"margin:0px;padding:0px;color:#CC0000;\">Note:<\/span>&nbsp;Chinese customs fee is 8 CNY per parcel.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Insurance fee (optional):<\/strong>\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\tInsurance fee purchased at 3% of the total price (Items fee + domestic shipping fee + International delivery fee + Service fee + Customs fee).\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;white-space:normal;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Can I get any discount on service fee?<\/strong><br style=\"margin:0px;padding:0px;\" \/>\r\nNormally, can't. Our service fee is 6% of (items price + domestic shipping fee).<br style=\"margin:0px;padding:0px;\" \/>\r\n<br style=\"margin:0px;padding:0px;\" \/>\r\n<strong style=\"margin:0px;padding:0px;\">When should I pay the service fee?<\/strong><br style=\"margin:0px;padding:0px;\" \/>\r\nYou will be asked to pay service charge together with the international shipping of your parcel. After you get the weight of your parcel and have selected the international shipping method, lrise.com will automatically calculate the service fee for you. At that point, you will need to pay the shipping costs and service fee, then lrise will ship your parcel.\r\n<\/p>","info_89":"","info_89_C":"","info_88":"","info_88_C":"<h2 class=\"tit_global\" style=\"white-space:normal;margin:0px 0px 40px;padding:0px;width:1230px;height:auto;border-bottom-color:#DFDFDF;border-bottom-style:solid;border-bottom-width:1px;color:#333333;font-family:Arial, Helvetica, sans-serif;line-height:normal;\">\r\n\tFAQ\r\n<\/h2>\r\n<h3 class=\"tit\" style=\"white-space:normal;color:#333333;font-family:Arial, Helvetica, sans-serif;line-height:19.1875px;margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t<a name=\"faq2\"><\/a><span style=\"line-height:1.6em;font-weight:normal;\"><strong>1.What is the exchange rate?<\/strong><\/span>\r\n<\/h3>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\t<span style=\"white-space:nowrap;\">The current exchange rate is 6.06 between USD and CNY, which might be adjusted according to real-time rate.<\/span>\r\n<\/p>\r\n<div class=\"faq_section02\" style=\"white-space:normal;width:1230px;height:auto;margin-bottom:20px;line-height:1.6em;color:#333333;font-family:Arial, Helvetica, sans-serif;\">\r\n\t<h3 class=\"tit\" style=\"margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t\t<a name=\"faq2\"><\/a>2.How much is your service fee?\r\n\t<\/h3>\r\n\t<p style=\"margin-top:0px;padding:0px;font-weight:bold;color:#666666;\">\r\n\t\t<span style=\"white-space:nowrap;\">The service fee is 6% of the item price and domestic shipping fee, with the minimum service fee of 30CNY.<\/span>\r\n\t<\/p>\r\n<\/div>\r\n<div class=\"faq_section02\" style=\"white-space:normal;width:1230px;height:auto;margin-bottom:20px;line-height:1.6em;color:#333333;font-family:Arial, Helvetica, sans-serif;\">\r\n\t<h3 class=\"tit\" style=\"margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t\t<a name=\"faq3\"><\/a>3.Which payment methods does LRISE&nbsp;accept?\r\n\t<\/h3>\r\n\t<p style=\"margin-top:0px;padding:0px;font-weight:bold;color:#666666;\">\r\n\t\t<span style=\"white-space:nowrap;\">Now the accepted payment methods include &nbsp;Credit Card, Web Money, Western Union and Bank transfer.<\/span>\r\n\t<\/p>\r\n<\/div>\r\n<h3 class=\"tit\" style=\"white-space:normal;margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t<a name=\"faq4\"><\/a>4.What shipping methods do you offer?\r\n<\/h3>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tWe offer many international shipping methods to meet varied shipping needs of customers from all around the world:\r\n<\/p>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tDHL,&nbsp;EMS,&nbsp;Air Parcel, SAL, Air small parcel, epacket,&nbsp;and Special line.\r\n<\/p>\r\n<h3 class=\"tit\" style=\"white-space:normal;margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t<a name=\"faq9\"><\/a>5.Which products can\u2019t we purchase for you?\r\n<\/h3>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tWe try our best to ship all items for our customers all over the world, but we cannot handle shipping of prohibited items:\r\n<\/p>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tliquid, power, battery, magnet, knife, medicine, seed, chemical, animals,toxic items beyond our purchasing ability, and other illegal products. Besides, we reserve the right to reject some illegal and unreasonable shipping requests.\r\n<\/p>\r\n<h3 class=\"tit\" style=\"white-space:normal;margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t<a name=\"faq10\"><\/a>6.How do I track my shipment?\r\n<\/h3>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tAfter your parcel has been shipped out, an email with the tracking No. and the website you can get the tracking information\r\n<\/p>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\twill be sent to your email box which is registered on our website. Also you can log in to your &nbsp;LRISE&nbsp;account to check \"my order\u201d and find a link to track the status of your shipment online.\r\n<\/p>\r\n<h3 class=\"tit\" style=\"white-space:normal;margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t<a name=\"faq11\"><\/a>7.How do I check my order status?\r\n<\/h3>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tOnce we receive the order, our buyer will purchase items for you at once, you can click\r\n<\/p>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\t\u201cMy order\u201d in your account to check the order status. After all the items under this order have arrived at our warehouse, we will inform you via email.\r\n<\/p>\r\n<h3 class=\"tit\" style=\"white-space:normal;margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t<a name=\"faq12\"><\/a>8.How do I estimate my delivery date?\r\n<\/h3>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tDifferent international shipping methods come with different shipping time. In the email informing\r\n<\/p>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tyou the parcel has been shipped out, you can find the estimated delivery time, so please pay attention to this email. If you have no idea that you have got the email, please contact our customer service and we will try to get info about your delivery date.\r\n<\/p>\r\n<h3 class=\"tit\" style=\"white-space:normal;margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t<a name=\"faq13\"><\/a>9.Do you guarantee the quality of items I bought?\r\n<\/h3>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tLRISE is not the product supplier, but offers services for buying items online from\r\n<\/p>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tChina stores for our customers who cannot buy them by themselves. We cannot see items until they have arrived at our warehouse, but we will inspect the quality of items and give you some advice if we notice the credit of the website or the shop is bad, according to our experience. Please remember: the items you get are worth the money you have paid for, and higher prices in most cases stand for higher quality.\r\n<\/p>\r\n<h3 class=\"tit\" style=\"white-space:normal;margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t<a name=\"faq14\"><\/a>10.Which websites can we purchase from?\r\n<\/h3>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tThere are many Chinese online stores that are popular among international shoppers!\r\n<\/p>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tWe recommend you: &nbsp;www.taobao.com,www.tmall.com,&nbsp;www.JD.COM, www.1688.com, www.paipai.com, www.dangdang.com, www.amazon.cn, www.vancl.com and so on.\r\n<\/p>\r\n<h3 class=\"tit\" style=\"white-space:normal;margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t<a name=\"faq15\"><\/a>11.How long can you keep my items in your warehouse?\r\n<\/h3>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tAfter the status of the item was changed into \u201carrived\u201d, it can be kept in our warehouse for up to 180 Days.\r\n<\/p>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tIf the item has been kept in our warehouse for more than 180 days, we will dispose your items. We believe 180 days are enough time for all customers to arrange their shopping and shipping.\r\n<\/p>\r\n<h3 class=\"tit\" style=\"white-space:normal;margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t<a name=\"faq19\"><\/a>12.What\u2019s the return policy of LRISE?\r\n<\/h3>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\tIf you find the received item distinctly different from what you ordered, please contact us at first,\r\n<\/p>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\twe will confirm with the seller whether they can accept the returned items. If yes, we will accept the returned item from you. But we are not responsible for any damages caused when shipping back to us for return.\r\n<\/p>\r\n<h3 class=\"tit\" style=\"white-space:normal;margin:0px 0px 10px;padding:0px;width:1230px;font-size:14px;\">\r\n\t<a name=\"faq20\"><\/a>13.If I find there is something wrong with my delivery address, what should I do?\r\n<\/h3>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\t<span style=\"white-space:nowrap;\">When you find that you have offered the wrong shipping address,<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\t<span style=\"white-space:nowrap;\">check your parcel is under which of the following conditions and act accordingly:<\/span><br \/>\r\n<span style=\"white-space:nowrap;\">1 If the parcel is not shipped out, please contact the customer service with the right shipping address, we can change it for you.<\/span><br \/>\r\n<span style=\"white-space:nowrap;\">2 If the parcel has been shipped out, and there is no tracking information yet on the tracking website;<\/span>\r\n<\/p>\r\n<p style=\"margin-top:0px;white-space:normal;padding:0px;font-weight:bold;color:#666666;\">\r\n\t<span style=\"white-space:nowrap;\">we can contact the logistics company to change the shipping address.<\/span><br \/>\r\n<span style=\"white-space:nowrap;\">3 If there is already tracking information of the parcel, we can do nothing to it.<\/span><br \/>\r\n<span style=\"white-space:nowrap;\">4 If the item cannot be delivered successfully, please contact the local post office holding your parcel to change the shipping address.<\/span>\r\n<\/p>","info_87":"","info_87_C":"<ul style=\"color:#333333;font-family:Arial, Helvetica, sans-serif;white-space:normal;margin:0px;padding:0px;\">\r\n\t<li style=\"margin:0px 0px 10px;padding:0px;list-style:none outside none;float:left;height:auto;width:760px;\">\r\n\t\t<h1 style=\"margin:0px;padding:0px 0px 15px;font-size:14px;float:left;line-height:30px;width:760px;border-bottom-width:1px;border-bottom-style:dotted;border-bottom-color:#CCCCCC;color:#FF9900;\">\r\n\t\t\t\u9000\u8d27\u653f\u7b56\r\n\t\t<\/h1>\r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t<strong style=\"margin:0px;padding:0px;\">Lrise\u7684\u9000\u8d27\u653f\u7b56\u662f\u4ec0\u4e48?<\/strong>\r\n\t\t<\/p>\r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t<strong style=\"margin:0px;padding:0px;\">\u6211\u600e\u4e48\u80fd\u9000\u56de\u6211\u7684\u4ea7\u54c1?<\/strong>\r\n\t\t<\/p>\r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t<strong style=\"margin:0px;padding:0px;\">\u6211\u9000\u8d27\u540e\u591a\u4e45\u80fd\u6536\u5230\u9000\u6b3e?<\/strong>\r\n\t\t<\/p>\r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t<strong style=\"margin:0px;padding:0px;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<strong style=\"background-color:#FFFFFF;margin:0px;padding:0px;\">Lrise\u7684\u9000\u8d27\u653f\u7b56\u662f\u4ec0\u4e48<\/strong>?<\/strong>\r\n\t\t<\/p>\r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t<br style=\"margin:0px;padding:0px;\" \/>\r\n\u56e0\u4e3a\u6211\u4eec\u53ea\u662f\u4ee3\u8d2d\uff0c\u4e0d\u662f\u5356\u5bb6\u6216\u8005\u751f\u4ea7\u5546\uff0c\u6240\u4ee5\u6211\u4eec\u4e0d\u63a5\u53d7\u9000\u8d27\uff0c\u9664\u975e\u60a8\u6536\u5230\u7684\u4ea7\u54c1\u662f\u9519\u8bef\u7684\u6216\u8005\u635f\u6bc1\u7684\u3002\u5982\u679c\u6709\u95ee\u9898\uff0c\u8bf7\u60a8\u5728\u7b7e\u6536\u4e4b\u65e5\u8d773\u65e5\u5185\u8054\u7cfb\u6211\u4eec\u5ba2\u670d\uff0c\u8fc7\u671f\u5c06\u4e0d\u53d7\u7406\u3002\r\n\t\t<\/p>\r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t<strong style=\"margin:0px;padding:0px;\">\u6ce8:&nbsp;<\/strong>\u8fd9\u79cd\u60c5\u51b5\u4e0b\u6211\u4eec\u4e0d\u63a5\u53d7\u60a8\u7684\u9000\u8d27:\r\n\t\t<\/p>\r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;\">\r\n\t\t\t1.<span style=\"font-family:arial, helvetica, sans-serif;line-height:24px;background-color:#FFFFFF