;\"><strong style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;color:#666666;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/span><\/strong><\/span> \r\n\t\t<\/p>\r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;background-color:#FFFFFF;list-style-type:none;text-indent:20px;line-height:20px;color:#666666;\">\r\n\t\t\t<span style=\"margin:0px;padding:0px;list-style-type:none;color:#FF0000;\"><strong style=\"margin:0px;padding:0px;\"><span style=\"margin:0px;padding:0px;color:#666666;\">Accident Claims:<\/span><\/strong><\/span> \r\n\t\t<\/p>\r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;background-color:#FFFFFF;list-style-type:none;text-indent:20px;line-height:20px;color:#666666;\">\r\n\t\t\t<span style=\"margin:0px;padding:0px;list-style-type:none;color:#FF0000;\"><\/span> \r\n\t\t<\/p>\r\n<span style=\"margin:0px;padding:0px;list-style-type:none;color:#FF0000;\"> \r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;background-color:#FFFFFF;list-style-type:none;color:#666666;\">\r\n\t\t\tIf you receive a wrong size\/color\/pattern\/quantity, a wrong parcel, a damaged item, lost item, etc, you can file a claim<span class=\"Apple-converted-space\"> <\/span><span style=\"margin:0px;padding:0px;list-style-type:none;color:#FF0000;\">within three working days<\/span><span class=\"Apple-converted-space\"> <\/span>after received your item.<span class=\"Apple-converted-space\"> <\/span><span style=\"margin:0px;padding:0px;list-style-type:none;color:#FF0000;\">Late claims will not be accepted.<\/span> \r\n\t\t<\/p>\r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;background-color:#FFFFFF;list-style-type:none;color:#666666;\">\r\n\t\t\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">Please note that the final delivery date is subject to the exact final delivery date on the tracking website.<\/strong> \r\n\t\t<\/p>\r\n\t\t<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;backgrou