d to cancel this order before you pay.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\tYou could click \u201c<strong style=\"margin:0px;padding:0px;\">select all<\/strong>\u201d to select all the order you want to pay.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\tYou could click \u201c<strong style=\"margin:0px;padding:0px;\">Delete the selected<\/strong>\u201d to cancel the order you have selected before.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\tYou could click \u201c<strong style=\"margin:0px;padding:0px;\">Add to my favorite<\/strong>\u201d to add this order to your favorite.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">3) Lrise's&nbsp;purchaser will help you buy the item after the payment is done.<\/strong> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\tAfter paid the items, your order will go to purchasing process. And you could check the order status in lrise&nbsp;account at any time. The status include: Await purchase, In purchasing, Await payment, Bought, Arrived, Refunded, Lost, Storing, Abandon.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/www.yoybuy.com\/Content\/Upload\/Text\/b68b0fab-96cb-43fd-b3ed-d2463872ac31.jpg\" alt=\"\" height=\"469\" width=\"558\" style=\"border-style:none;margin:0px 160px 0px 0px;padding:0px;vertical-align:middle;list-style-type:none;\" \/> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;direction:ltr;list-style-type:none;\"><strong style=\"margin:0px;padding:0px;list-style-type:none;\">Await purchase:<\/strong> The item has not been purchased yet, (in this status, you can delete this item if you like).<\/span> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;direction:ltr;list-style-type:none;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/span> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">In purchasing:<\/strong> Our purchaser is buying this item now. Once purchased, you cannot delete it.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">Await payment:<\/strong><span style=\"margin:0px;padding:0px;font-size:9pt;\"> You need to pay more to buy this item. Because the domestic delivery fee is usually not sufficient. Please click the \u201cpay now\u201d button to pay the remainder or you can cancel this item and get refund.<\/span> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<span style=\"margin:0px;padding:0px;font-size:9pt;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/span> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">Bought:<\/strong> The item has been bought.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">Arrived:<\/strong> The items have arrived at Lrise's warehouse.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">Refunded:<\/strong> The money for this item has been refunded back into your account. If you can't find your order, please go to \u201crefund\u201d to check your order.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">Lost: <\/strong><span style=\"margin:0px;padding:0px;font-size:9pt;\">Your items have lost in lrise but please do not worry and&nbsp; we will compensate you; or you can directly contact our customer service department for help.<\/span> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">Storing: <\/strong><span style=\"margin:0px;padding:0px;font-size:9pt;\">Your item has been stored in our warehouse.As our free storage time is 90 days,please submit delivery as soon as possible.<\/span> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;list-style-type:none;\">Abandon:<\/strong> <span style=\"margin:0px;padding:0px;font-size:9pt;\">Lrise storage time is 180 days, and you don't submit delivery during this time. We will think that you have given up your items and we will handle them in our way. (They don't &nbsp;belong to you any more)<\/span> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\tYou can click this \u201c<strong style=\"margin:0px;padding:0px;\">chat<\/strong>\u201d to talk to our purchaser if you have any requests for the items.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#666666;list-style-type:none;\">\r\n\t<img src=\"http:\/\/www.yoybuy.com\/Content\/Upload\/Text\/e0d50b9a-cac5-460a-8ccb-aa5af4e8b536.jpg\" alt=\"\" height=\"73\" width=\"506\" style=\"border-style:none;margin:0px;padding:0px;ver