to receive.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Received<\/strong>: You have received the goods and signed for it.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">OK<\/strong>: You have evaluted our service.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Await process<\/strong>: Your parcel is waiting for processing. Before processing, you can choose to cancel the parcel shipping. After cancelling,&nbsp; the second payment will be refunded to your account automatically. (If you have used the e-coupon, it will not be returned once you cancel the delivery.)\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<strong style=\"margin:0px;padding:0px;\"><strong style=\"margin:0px;padding:0px;\">Await:<\/strong><\/strong> You should pay the difference because your estimate weight is smaller than real weight.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\tYou can click \"<strong style=\"margin:0px;padding:0px;\">confirm receipt<\/strong>\" when you had received your parcel. And then you can make the evaluation of our services.\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;font-family:Arial, Helvetica, sans-serif;background-color:#FFFFFF;color:#666666;list-style-type:none;\">\r\n\t<