s \r\ntime. So it means you have given up your items and we will handle them \r\nin our way. (They don't &nbsp;belong to you any more)\r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;white-space:normal;-webkit-text-size-adjust:none;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;\">Note: 1) If your item has some problems, our purchaser will leave a message for you, <strong style=\"margin:0px;padding:0px;\"><strong style=\"margin:0px;padding:0px;\">Please click the \" chat\" and reply when there is a \"new\" on it.<\/strong><\/strong><\/strong> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;white-space:normal;-webkit-text-size-adjust:none;background-color:#FFFFFF;\">\r\n\t<img src=\"http:\/\/crm.yoybuy.com\/YOYPhoto\/2012\/0425\/0\/S1024_5DFCC9A5253444E3825CB71F9BF9F0AF.jpg\" alt=\"undefined\" style=\"margin:0px;padding:0px 10px 0px 0px;border-style:none;\" \/> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;white-space:normal;-webkit-text-size-adjust:none;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;direction:ltr;\">2) &nbsp;When your&nbsp;domestic delivery fee or item's fee is not sufficient, you should&nbsp;click the \u201cpay\u201d button to pay the remainder. <br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;white-space:normal;-webkit-text-size-adjust:none;background-color:#FFFFFF;\">\r\n\t<strong style=\"margin:0px;padding:0px;direction:ltr;\"><br style=\"margin:0px;padding:0px;\" \/>\r\n<\/strong> \r\n<\/p>\r\n<p style=\"margin-top:0px;margin-bottom:0px;padding:0px;color:#333333;font-family:Arial, Helvetica, sans-serif;white-space:normal;-webkit-text-size-a